export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        Nicname: "제로초",
      },
      content: "첫번째 게시글",
      Images: [
        { src: "http://www.naver.com" },
        { src: "http://www.naver.com" },
        { src: "http://www.naver.com" },
      ],
      Contents: [{}],
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
